import { Link } from 'react-router-dom';
import './SelectUser.css'

function SelectUser() {
    return (
        <div className="container">
            <div className="row justify-content-center">
               
                    <Link to="/" className="img-position shadow col-lg-4 col-md-6 col-sm-12"><img className="btn-image" alt="user" src="https://res.cloudinary.com/getapet/image/upload/v1618902177/web%20sources/teamwork_jqxzg6.png"/></Link>
                
                
                    <Link to="/" className="img-position shadow col-lg-4 col-md-6 col-sm-12"><img className="w" alt="shelter" src="https://res.cloudinary.com/getapet/image/upload/v1618902177/web%20sources/animal-shelter_bz8fod.png"/></Link>
           
            </div>
        </div>

    );
}

export default SelectUser;
